g? // Optional title for the chat session\n  isActive  Boolean  @default(true)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  user     User          @relation(fields: [userId], references: [id], onDelete: Cascade)\n  messages ChatMessage[]\n\n  @@index([userId])\n  @@index([isActive])\n  @@index([createdAt])\n}\n\n// Individual chat messages\nmodel ChatMessage {\n  id          String      @id @default(uuid())\n  sessionId   String\n  userId      String\n  type        MessageType // USER, AI, or SYSTEM\n  content     String      @db.Text\n  metadata    Json? // For storing additional data like tokens, model used, etc.\n  isDelivered Boolean     @default(false)\n  isRead      Boolean     @default(false)\n  createdAt   DateTime    @default(now())\n\n  // Relations\n  session ChatSession @relation(fields: [sessionId], references: [id], onDelete: Cascade)\n  user    User        @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@index([sessionId])\n  @@index([userId])\n  @@index([type])\n  @@index([createdAt])\n}\n\n// Unified AI Request model\nmodel AIRequest {\n  id         String  @id @default(uuid())\n  senderId   String\n  receiverId String?\n\n  dataOne     String\n  dataTwo     String\n  dataThree   String\n  promptText  String   @db.Text\n  aiResponse  String   @db.Text\n  isProcessed Boolean  @default(false)\n  isDelivered Boolean  @default(false)\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations\n  sender   User  @relation(\"UserRequestSender\", fields: [senderId], references: [id])\n  receiver User? @relation(\"UserDataReceiver\", fields: [receiverId], references: [id])\n\n  @@index([senderId])\n  @@index([receiverId])\n  @@index([isProcessed])\n  @@index([isDelivered])\n}\n\n// Unified Patient info for all user types\nmodel PatientInfo {\n  id             String   @id @default(uuid())\n  userId         String   @unique\n  dateOfBirth    DateTime\n  gender         Gender\n  phoneNumber    String\n  address        String\n  medicalHistory String\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relation\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@index([userId])\n}\n\nmodel DoctorInfo {\n  id              String   @id @default(uuid())\n  userId          String   @unique\n  fullName        String\n  specialization  String\n  licenseNumber   String   @unique\n  phoneNumber     String\n  address         String\n  experience      Int\n  bio             String?\n  consultationFee Decimal?\n  isVerified      Boolean  @default(false)\n  createdAt       DateTime @default(now())\n  updatedAt       DateTime @updatedAt\n\n  // Relation\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@index([userId])\n  @@index([specialization])\n  @@index([isVerified])\n}\n\n// Unified notifications\nmodel Notification {\n  id        String   @id @default(uuid())\n  userId    String\n  title     String\n  message   String   @db.Text\n  type      String?\n  data      Json?\n  isRead    Boolean  @default(false)\n  createdAt DateTime @default(now())\n\n  // Relation\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@index([userId])\n  @@index([isRead])\n  @@index([createdAt])\n  @@index([type])\n}\n",
